import React from 'react';
import styles from './styles.module.css';
import stockicon from '../../Assets/SVGs/stock-icon.svg';
import techicon from '../../Assets/SVGs/tech-icon.svg';
import bankicon from '../../Assets/SVGs/bank-icon.svg';
import History from '../../Assets/SVGs/History.svg';

const getIconPath = (category) => {
    switch (category) {
        case 'Banking':
            return bankicon;
        case 'Technology':
            return techicon;
        case 'Stocks':
            return stockicon;
        default:
            return 'default-icon';
    }
};

const StockHistory = ({ filteredData }) => {
    return (
        <div className={styles.shsearchContainer}>
            <div className={styles.sRecent}>
                <img src={History} alt="Recommended" className={styles.sRecent-icon} />
                <div className={styles.sRecent-title}>Recently Viewed</div>
            </div>
            <ul className={`${styles.shSearchResults} ${styles.scrollbar}`}>
            
                {filteredData.map((item) => (
                    <li key={item.symbol} className={styles.shsearch-item}>
                        <img
                            src={getIconPath(item.category)}
                            alt={`${item.name} icon`}
                            className={styles.shicon}
                        />
                        <div className={styles.shitem-info}>
                            <div className={styles.shsymbol}>{item.symbol}</div>
                            <div className={styles.shname}>{item.name}</div>
                        </div>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default StockHistory;
